import math

class Solution(object):
    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """
        ans=[]
        for i in range(len(numbers)):
        	left=i+1
        	right=len(numbers)-1
        	while left<=right:
        		mid=(left+right)//2
        		if numbers[i]+numbers[mid]==target:
        			ans.append(i+1)
        			ans.append(mid+1)
        			return ans
        		elif numbers[i]+numbers[mid]<target:
        			left=mid+1
        		elif numbers[i]+numbers[mid]>target:
        			right=mid-1
      



